    true,nt"url": null,nt"notes": "The DataFerrett tool is used to search American
    Community Survey Public Use Microdata, Current Population Survey (CPS), CPS supplemental
    surveys, Survey of Income and Program Participation (SIPP), SIPP Topical Module
    surveys, Small Area Health Insurance Estimates, Survey of Program Dynamics, the
    American Housing Survey, National Survey of Fishing, Hunting, and Wildlife Associated
    Recreation, The New York City Housing and Vacancy Survey, County Business Patterns,
    and the Public Libraries Survey. It is an online analytically oriented, self-service
    tool designed to deliver a wide variety of population, health, economic, geographic
    and housing information about the United States to individuals, businesses, governments,
    and organizations. This tool provides easy access to accurate, relevant, and timely
    information that supports learning, facilitates decision-making, empowers individuals,
    and strengthens communities.",nt"license_title": "U.S. Government Work",nt"extras":
